INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (7001, "2030/12/17 14:59:59", 106001, 1, 1, 7, "2015/12/17 15:00:00", 0.0, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (7002, "2030/12/17 14:59:59", 105901, 1, 1, 7, "2015/12/17 15:00:00", 0.0, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (7003, "2030/12/17 14:59:59", 105801, 1, 1, 7, "2015/12/17 15:00:00", 0.0, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (10001, "2030/12/17 14:59:59", 105801, 1, 1, 10, "2015/12/17 15:00:00", 0.0, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (10002, "2030/12/17 14:59:59", 106001, 1, 1, 10, "2015/12/17 15:00:00", 0.0, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (10003, "2030/12/17 14:59:59", 105901, 1, 1, 10, "2015/12/17 15:00:00", 0.0, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (10004, "2030/12/17 14:59:59", 106401, 1, 1, 10, "2015/12/17 15:00:00", 0.0, 2104010, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (12001, "2030/12/17 14:59:59", 105801, 1, 1, 12, "2015/12/17 15:00:00", 0.0, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (13001, "2030/12/17 14:59:59", 106001, 1, 1, 13, "2015/12/17 15:00:00", 0.0, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (13002, "2030/12/17 14:59:59", 105901, 1, 1, 13, "2015/12/17 15:00:00", 0.0, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (13003, "2030/12/17 14:59:59", 106401, 1, 1, 13, "2015/12/17 15:00:00", 0.0, 2104010, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (13004, "2030/12/17 14:59:59", 105801, 1, 1, 13, "2015/12/17 15:00:00", 0.0, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (14001, "2030/12/17 14:59:59", 105901, 1, 1, 14, "2015/12/17 15:00:00", 0.0, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (14002, "2030/12/17 14:59:59", 106401, 1, 1, 14, "2015/12/17 15:00:00", 0.0, 2104010, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (14003, "2030/12/17 14:59:59", 105801, 1, 1, 14, "2015/12/17 15:00:00", 0.0, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (14004, "2030/12/17 14:59:59", 106001, 1, 1, 14, "2015/12/17 15:00:00", 0.0, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (15001, "2030/12/17 14:59:59", 105901, 1, 1, 15, "2015/12/17 15:00:00", 0.0, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (16001, "2030/12/17 14:59:59", 106401, 1, 1, 16, "2015/12/17 15:00:00", 0.0, 2104010, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (16002, "2030/12/17 14:59:59", 105801, 1, 1, 16, "2015/12/17 15:00:00", 0.0, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (16003, "2030/12/17 14:59:59", 106001, 1, 1, 16, "2015/12/17 15:00:00", 0.0, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (16004, "2030/12/17 14:59:59", 105901, 1, 1, 16, "2015/12/17 15:00:00", 0.0, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (17002, "2030/12/17 14:59:59", 105901, 1, 1, 17, "2015/12/17 15:00:00", 0.0, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (17004, "2030/12/17 14:59:59", 106001, 1, 1, 25, "2015/12/17 15:00:00", 0.0, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (17005, "2030/12/17 14:59:59", 105901, 1, 1, 25, "2015/12/17 15:00:00", 0.0, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (17006, "2030/12/17 14:59:59", 106401, 1, 1, 25, "2015/12/17 15:00:00", 0.0, 2104010, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (17007, "2030/12/17 14:59:59", 105801, 1, 1, 25, "2015/12/17 15:00:00", 0.0, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (18001, "2030/12/17 14:59:59", 190801, 1, 1, 18, "2015/12/17 15:00:00", 0.0, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (18002, "2030/12/17 14:59:59", 190801, 2, 1, 18, "2015/12/17 15:00:00", 0.0, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (19001, "2030/12/17 14:59:59", 190801, 3, 1, 19, "2015/12/17 15:00:00", 0.0, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (19002, "2030/12/17 14:59:59", 190801, 4, 1, 19, "2015/12/17 15:00:00", 0.0, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (20001, "2030/12/17 14:59:59", 190801, 5, 1, 20, "2015/12/17 15:00:00", 0.0, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (20002, "2030/12/17 14:59:59", 190801, 6, 1, 20, "2015/12/17 15:00:00", 0.0, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (21001, "2030/12/17 14:59:59", 106001, 1, 1, 21, "2015/12/17 15:00:00", 0.0, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (21002, "2030/12/17 14:59:59", 105901, 1, 1, 21, "2015/12/17 15:00:00", 0.0, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (21003, "2030/12/17 14:59:59", 106401, 1, 1, 21, "2015/12/17 15:00:00", 0.0, 2104010, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (21004, "2030/12/17 14:59:59", 105801, 1, 1, 21, "2015/12/17 15:00:00", 0.0, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (22001, "2030/12/17 14:59:59", 190801, 1, 1, 22, "2015/12/17 15:00:00", 0.0, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (22002, "2030/12/17 14:59:59", 190801, 2, 1, 22, "2015/12/17 15:00:00", 0.0, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (23001, "2030/12/17 14:59:59", 190801, 3, 1, 23, "2015/12/17 15:00:00", 0.0, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (23002, "2030/12/17 14:59:59", 190801, 4, 1, 23, "2015/12/17 15:00:00", 0.0, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, 0.0, 1, "カリン", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24001, "2030/12/17 14:59:59", 109001, 1, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, 4.08, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24002, "2030/12/17 14:59:59", 109001, 2, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, 5.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24003, "2030/12/17 14:59:59", 109001, 3, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, 10.11, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24004, "2030/12/17 14:59:59", 109001, 4, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, 4.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24005, "2030/12/17 14:59:59", 109001, 5, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, 6.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24006, "2030/12/17 14:59:59", 109002, 6, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 0.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24007, "2030/12/17 14:59:59", 109002, 7, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 0.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24008, "2030/12/17 14:59:59", 109002, 8, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 0.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24009, "2030/12/17 14:59:59", 109002, 9, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 0.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24010, "2030/12/17 14:59:59", 109002, 10, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 0.0, 1, "エリコ（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24011, "2030/12/17 14:59:59", 109101, 1, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, 2.12, 1, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24012, "2030/12/17 14:59:59", 109101, 2, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, 4.19, 5, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24013, "2030/12/17 14:59:59", 109101, 3, 4, 24, "2019/01/31 12:00:00", 8.0, 0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, 2.3, 2, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24014, "2030/12/17 14:59:59", 109102, 4, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 0.0, 1, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24015, "2030/12/17 14:59:59", 109101, 5, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, 5.23, 5, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24016, "2030/12/17 14:59:59", 109102, 6, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 0.0, 1, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24017, "2030/12/17 14:59:59", 109101, 7, 2, 24, "2019/01/31 12:00:00", 8.0, 0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, 5.01, 1, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24018, "2030/12/17 14:59:59", 109102, 8, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 0.0, 1, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24019, "2030/12/17 14:59:59", 109102, 9, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 0.0, 1, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (24020, "2030/12/17 14:59:59", 109102, 10, 1, 24, "2019/01/31 12:00:00", 0.0, 0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 0.0, 1, "シズル（バレンタイン）", 10011);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (26001, "2030/12/17 14:59:59", 106401, 1, 1, 26, "2015/12/17 15:00:00", 0.0, 2104010, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (26002, "2030/12/17 14:59:59", 105801, 1, 1, 26, "2015/12/17 15:00:00", 0.0, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (26003, "2030/12/17 14:59:59", 106001, 1, 1, 26, "2015/12/17 15:00:00", 0.0, 0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (26004, "2030/12/17 14:59:59", 105901, 1, 1, 26, "2015/12/17 15:00:00", 0.0, 0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (27001, "2030/12/17 14:59:59", 106401, 1, 1, 27, "2015/12/17 15:00:00", 0.0, 2104010, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", -363.0, 0.0, 2, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (27002, "2030/12/17 14:59:59", 105801, 1, 1, 27, "2015/12/17 15:00:00", 0.0, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (27003, "2030/12/17 14:59:59", 106001, 1, 1, 27, "2015/12/17 15:00:00", 0.0, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (27004, "2030/12/17 14:59:59", 105901, 1, 1, 27, "2015/12/17 15:00:00", 0.0, 0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (28001, "2030/12/17 14:59:59", 190801, 1, 1, 28, "2019/09/24 15:00:00", 0.0, 0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", -363.0, 0.0, 1, "カリン", 0);
