INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (41001, "2030/12/17 14:59:59", 106401, 1, 1, 41, "2015/12/17 15:00:00", 0.0, 2104010, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", -363.0, 0.0, 1, "シェフィ", 0);
