INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (41003, "2030/12/17 14:59:59", 106001, 1, 1, 41, "2015/12/17 15:00:00", 0.0, 0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (41004, "2030/12/17 14:59:59", 105901, 1, 1, 41, "2015/12/17 15:00:00", 0.0, 0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (42001, "2030/12/17 14:59:59", 105901, 1, 1, 42, "2015/12/17 15:00:00", 0.0, 0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", -416.5, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (42002, "2030/12/17 14:59:59", 106401, 1, 1, 42, "2015/12/17 15:00:00", 0.0, 2104010, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", -416.5, 0.0, 1, "シェフィ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (42003, "2030/12/17 14:59:59", 105801, 1, 1, 42, "2015/12/17 15:00:00", 0.0, 0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", -416.5, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (42004, "2030/12/17 14:59:59", 106001, 1, 1, 42, "2015/12/17 15:00:00", 0.0, 0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", -416.5, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (43001, "2030/12/17 14:59:59", 105801, 1, 1, 43, "2015/12/17 15:00:00", 0.0, 0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", -363.0, 0.0, 1, "ペコリーヌ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (43002, "2030/12/17 14:59:59", 105901, 1, 1, 43, "2015/12/17 15:00:00", 0.0, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", -363.0, 0.0, 1, "コッコロ", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (43003, "2030/12/17 14:59:59", 106001, 1, 1, 43, "2015/12/17 15:00:00", 0.0, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", -363.0, 0.0, 1, "キャル", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (43004, "2030/12/17 14:59:59", 123001, 1, 1, 44, "2015/12/17 15:00:00", 0.0, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", -416.5, 0.0, 1, "アメス", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (43005, "2030/12/17 14:59:59", 123001, 2, 1, 44, "2015/12/17 15:00:00", 0.0, 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", -416.5, 0.0, 1, "アメス", 0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (43006, "2030/12/17 14:59:59", 123001, 3, 2, 45, "2015/12/17 15:00:00", 0.0, 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", -416.5, 5.79, 1, "アメス", 0);
